//import logo from './logo.svg';
import React, { Component } from "react";
import "./App.css";

class App extends Component {
    render() {
        return (
            <div className="img">
               <label for="nameInput">Employee Name:</label>
               <input id="input" class="truncate" type="search" autocomplete="off" spellcheck="false" role="combobox" aria-controls="matches" placeholder="Search Google or type a URL" aria-expanded="false" aria-live="polite"></input>

<label for="nameInput">Employee id:</label>
               <input id="input" class="truncate" type="search" autocomplete="off" spellcheck="false" role="combobox" aria-controls="matches" placeholder="Search Google or type a URL" aria-expanded="false" aria-live="polite"></input>
<label for="nameInput">Department:</label>
               <input id="input" class="truncate" type="search" autocomplete="off" spellcheck="false" role="combobox" aria-controls="matches" placeholder="Search Google or type a URL" aria-expanded="false" aria-live="polite"></input>




            </div>
        );
    }
}

export default App;
